import React from "react";
// import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

import Logo from "../Logo/Logo";
import "./Header.scss";

class Header extends React.Component {
  render() {
    return (
      <div className="site">
        <nav>
          <ul className="haut">
            <Logo />
            <li id="connexion">
              <a href="connexion/connexion.html">CONNEXION</a>
            </li>
          </ul>
        </nav>
        <div id="dimension">
          <ul className="bas">
            <li>
              <a href="#">ACTUALITE</a>
            </li>
            <li>
              <a href="#">SHOP</a>
            </li>
            <li>
              <a href="#">CONTACT</a>
            </li>
            <li>
              <a href="#">RECHERCHE</a>
            </li>
          </ul>
          <figure className="">
            <img
              src={require("./img_header/jordanLA.png")}
              alt="La Jordan LA page d'accueil SneakerBis"
              className="imgaccueil"
            />
          </figure>
        </div>
      </div>
    );
  }
}

export default Header;
